import {Link} from 'react-router-dom'
import './Nav.css'
let Nav = () =>{
    return(
        <nav className='nav'>
            <p>Results Portal</p>
            <><Link to = '/'>Home</Link></>
            <Link to = '/result'>Results</Link>
            <Link to = '/add-results'>Store-Results</Link>
        </nav>
    )
}
export default Nav;
